import logo from './logo.svg';
import './App.css';
import LoginPage from './pages/LoginPage';
import HomePage from './pages/HomePage';
import { BrowserRouter as Router, Route, Redirect, Switch } from 'react-router-dom';


function App() {
  return (
    <Router>
      <Route>
        <LoginPage />
      </Route> 
      <Route>
        <HomePage />
      </Route>
    </Router>
  );
}

export default App;
